              title= "Title" 
              text="text" />
            </div>
            <div className="col-auto">
            <Cards 
              img="https://images.pexels.com/photos/2067659/pexels-photo-2067659.jpeg?cs=srgb&dl=beautiful-environment-idyllic-2067659.jpg&fm=jpg" 
              title= "Title" 
              text="text" />
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
